import React from 'react'
import { useNavigate } from 'react-router-dom'
import './Header.css'

function Header() {

    const navigate=useNavigate();
    return (
        <div className='navbar'>
        
            <button onClick={()=>navigate} className='userLogout'>LOGOUT</button>
    </div>
    )
}

export default Header
